import { useEffect, useState} from "react";

const DobavljacPage=()=>{
const [dobavljac,setDobavljac]=useState(null);
useEffect(()=>{
const fetchDobavljaci=async()=>{
const response=await fetch('/api/dobavljaci/')
const json=await response.json();

if(response.ok){
setDobavljac(json);
}


}
fetchDobavljaci();
},[])

return(
    <div >
        <div className="dobavljac">
        {dobavljac &&dobavljac.map((dobavlja)=>{
            <p key={dobavljac._id}>{dobavlja.naziv}{dobavlja.jib}</p>
        })}
        </div>
    </div>
)


}

export default DobavljacPage;
